import PropTypes from 'prop-types'
import Button from './Button'


const Header = ({ title }) => {
    return (
        <header className='header'>
            <h1>{title}</h1>
            <Button color='gray' title='Search'/>
        </header>
    )
}

Header.defaultProps = {
    title: "Google Search",
}

Header.propTypes = {
    title: PropTypes.string.isRequired,
}

